import Header from "./components/Header";
import Slider from "./components/Slider";
import Content from "./components/Content";
import Footer from "./components/Footer";
import Login from "./pages/Login";
function App() {
  return (
    <>
    <div className="App">
    <Header />
    <Slider />
    <Content />
    <Footer />
    <Login />
    </div>
    </>
  );
}
export default App;
